import React, { useState } from "react";
import Slider from "@mui/material/Slider";
import Typography from "@mui/material/Typography";

const ROICalculator = () => {
  const [students, setStudents] = useState(1000);

  // Assuming the number of questions answered increases linearly with the number of students
  const calculateQuestionsAnswered = (numStudents) => {
    // Example formula: 10 questions per student per year
    return numStudents * 10;
  };

  const handleSliderChange = (event, newValue) => {
    setStudents(newValue);
  };

  return (
    <div className="w-72 mx-auto text-center">
      <Typography className="text-4xl font-bold mb-4">
        ROI Calculator
      </Typography>
      <Typography className="text-2xl mb-2">
        Number of Students: {students}
      </Typography>
      <Slider
        value={students}
        onChange={handleSliderChange}
        aria-labelledby="students-slider"
        min={0}
        max={5000}
        step={100}
        className=""
      />
      <Typography className="text-4xl">
        Estimated Questions Answered: {calculateQuestionsAnswered(students)}
      </Typography>
    </div>
  );
};

export default ROICalculator;
